import React, { useState, useEffect } from "react";
import axios from "axios";



function App() {
  const [employee, setEmployee] = useState({
    list: []
  })

  useEffect(() => {
    axios.get("https://randomuser.me/api/?results=20").then(res => {
      console.
      setEmployee({ list: res.data })
    })
  }, [])

  return (
    <div>
      {employee.list.length ? employee.list.map(emp => <p>{emp}</p>) : <h1>None there</h1>
      }
    </div>
  );
}

export default App;
